const generator = () => {

  const storage = [];
  let i = 1;
  let gBrand, gType, gName, gReviews, gStars, gQuestions, len, holder, spot;

  while (i <= 100) {

    gBrand = brand[Math.floor(Math.random() * brand.length)],
    gType = type[Math.floor(Math.random() * type.length)];
    gName = name[Math.floor(Math.random() * name.length)];
    gReviews = Math.floor(Math.random() * 1000);
    gStars = Math.floor(Math.random() * 5) + 1;
    gQuestions = Math.floor(Math.random() * 50);

    len = tier.length;
    random = Math.ceil(Math.random() * 5);

    for (let j = 1; j <= random; j++) {
      if (i > 100) break;
      spot = Math.floor(Math.random() * len);

      storage.push({
        id: i,
        tier: tier[spot],
        brand: gBrand,
        type: gType,
        name: gName,
        product_options: {
          color: color,
          size: size        
        },
        price: {
          msrp: Math.ceil(Math.random() * 400) - 0.02
        },
        reviews: gReviews,
        stars: gStars,
        questions: gQuestions,
        is_prime: Math.floor(Math.random() * 2),
        stock_count: Math.floor(Math.random() * 100),
        about_product: [sentences[Math.floor(Math.random() * sentences.length)], 
          sentences[Math.floor(Math.random() * sentences.length)], 
          sentences[Math.floor(Math.random() * sentences.length)]],
        seller: "Amazon"
      });
      
      storage[i - 1].price.list = Math.floor((storage[i - 1].price.msrp) * (100 - Math.ceil(Math.random() * 2) * 5)) / 100;
      storage[i - 1].price.sale = Math.floor((storage[i - 1].price.msrp) * (100 - Math.ceil(Math.random() * 4) * 10)) / 100;

      holder = tier[len - 1];
      tier[len - 1] = tier[spot];
      tier[spot] = holder;
      len--;
      i++;
    }
  }
  return storage;
}

